import React, { useEffect, useState } from "react";

import { apiGet } from "../utils/api";

const InvoiceIndex = () => {
    const [invoiceState, setInvoices] = useState([]);

    useEffect(() => {
        apiGet("/api/invoices").then((data) => setInvoices(data));
    }, []);

    return (
        <div>
            <h1>Seznam faktur</h1>




        </div>
    );
};

export default InvoiceIndex;
